import './App.css'; 
import Header_bootstrap from "./Header_bootstrap"; 
import SellerUpload from './SellerUpload.js'; 
import './script.js'; 
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App">
        <Header_bootstrap />
        <SellerUpload />
        <script src="script.js"></script>
      </div>
    </Router>
  );
}

export default App;
